// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { ChakraProvider, extendTheme } from '@chakra-ui/react'; // These are correct

// You can customize the theme if you like
const theme = extendTheme({
  colors: {
    brand: {
      50: "#e6e0ff",
      100: "#c3b3ff",
      200: "#a085ff",
      300: "#7b58ff",
      400: "#542bff",
      500: "#2a00ff", // Your primary color
      600: "#2400e6",
      700: "#1d00cc",
      800: "#1600b3",
      900: "#0e0099",
    },
  },
  styles: {
    global: {
      body: {
        bg: '#f8f9fa', // Light background for the whole app
        color: 'gray.800',
      },
    },
  },
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ChakraProvider theme={theme}>
      <App />
    </ChakraProvider>
  </React.StrictMode>
);
